    async Task LoadClientes()
    {
        clientes = await http.GetFromJsonAsync<List<Cliente>>("api/cliente");
    }

    async Task ExcluirCliente(int ID) 
    {
        await http.DeleteAsync($"api/cliente/{ID}");
        await LoadClientes();
    }

